import React from "react";
import Counter from "./Counter";

class ClassCounter extends React.Component {

    constructor(props){
        super(props);
        this.state= {
            count: 0
        }
    }

    render(){
        return(
            <div>
                <h1>{this.state.value}</h1>
                <input type="text" value={this.value} onChange={event => SetValue(event.target.this.value)}></input>
            </div>
        )
    }
}

export default ClassCounter;
